#--------------------------DATABASE AND TABLES CREATE--------------------------------- 

DROP DATABASE IF EXISTS BABISRENT;
CREATE DATABASE BABISRENT;
ALTER DATABASE BABISRENT DEFAULT CHARACTER SET UTF8 DEFAULT COLLATE UTF8_GENERAL_CI;
USE BABISRENT;



CREATE TABLE `Employee` (
	`username` varchar(25) NOT NULL ,
	`password` varchar(25) NOT NULL,
	`officeaa` INT(4) NOT NULL,
	`fname` varchar(20) NOT NULL,
	`lname` varchar(20) NOT NULL,
	`tel` varchar(10) NOT NULL,
	`mail` varchar(40) NOT NULL,
	`salary` DECIMAL(20) NOT NULL,
	PRIMARY KEY (`username`)
);

CREATE TABLE `location` (
	`aa` INT(4) NOT NULL ,
	`road` varchar(50) NOT NULL,
	`number` INT(3) NOT NULL,
	`city` varchar(20) NOT NULL,
	`nomos` varchar(20) NOT NULL,
	`tk` INT(5) NOT NULL,
	`tel` varchar(10) NOT NULL,
	PRIMARY KEY (`aa`)
);

CREATE TABLE `car` (
	`plate` varchar(9) NOT NULL ,
	`officeaa` INT(4) NOT NULL,
	`mid` INT(10) NOT NULL,
	`xronologias` INT(4) NOT NULL,
	`persons` INT(1) NOT NULL,
	`cc` INT(4) NOT NULL,
	`fueltype` varchar(10) NOT NULL,
	`taxitites` varchar(10) NOT NULL,
	`cat` INT(2) NOT NULL,
	PRIMARY KEY (`plate`)
);

CREATE TABLE `person` (
	`username` varchar(25) NOT NULL  ,
	`mail` varchar(40) NOT NULL,
	`Fname` varchar(20),
	`Lname` varchar(30),
	`road` varchar(60) NOT NULL,
	`number` INT(3) NOT NULL,
	`city` varchar(20) NOT NULL,
	`nomos` varchar(20) NOT NULL,
	`tk` INT(5) NOT NULL,
	`tel` varchar(10) NOT NULL,
	`DOB` DATE NOT NULL,
	`DLdate` DATE NOT NULL,
	`creditcard` varchar(10) NOT NULL,
	`bonus` numeric(13,6),
	CONSTRAINT CheckAge CHECK (DOB > 18),
    CONSTRAINT CheckAge CHECK (DLdate >=1),
    PRIMARY KEY (`username`)
    
);

CREATE TABLE `partner` (
	`partnerno` INT(3) NOT NULL,
	`pname` varchar(100) NOT NULL ,
	PRIMARY KEY (`partnerno`)
);

CREATE TABLE `service` (
	`serviceno` INT(3) NOT NULL,
	`partnerno` INT(3) NOT NULL ,
	`description` TEXT(500) NOT NULL ,
	`rpoints` INT(8) NOT NULL,
	PRIMARY KEY (`serviceno`,`partnerno`)
);

CREATE TABLE `chooses` (
	`no` INT NOT NULL AUTO_INCREMENT ,
	`serviceno` INT(3) NOT NULL,
	`username` varchar(25) NOT NULL,
	PRIMARY KEY (`no`)
);

CREATE TABLE `rents` (
	`rentno` INT NOT NULL AUTO_INCREMENT,
	`plate` varchar(9) NOT NULL ,
	`username` varchar(25) ,
	`rentdate` DATE ,
	`returndate` DATE ,
	`pickupofficeno` INT(4) ,
	`returnofficeno` INT(4) ,
	`total` NUMERIC(13,6) ,
     CONSTRAINT CheckAge CHECK (rentdate > returndate),
	PRIMARY KEY (`rentno`,`plate`,`username`)
    
);

CREATE TABLE `client` (
	`username` varchar(25) NOT NULL ,
	`password` varchar(25) NOT NULL,
	PRIMARY KEY (`username`)
);

CREATE TABLE `comp` (
	`username` varchar(25) NOT NULL ,
	`mail` varchar(40) NOT NULL,
	`compname` varchar(60) ,
	`road` varchar(50) NOT NULL,
	`number` INT(3) NOT NULL,
	`city` varchar(20) NOT NULL,
	`nomos` varchar(20) NOT NULL,
	`tk` INT(5) NOT NULL,
	`tel` varchar(10) NOT NULL,
	`RFname` varchar(20),
	`RLname` varchar(20),
	`Rtel` varchar(10),
	PRIMARY KEY (`username`)
);

CREATE TABLE `renteksoplismos` (
	`no` INT(15) NOT NULL AUTO_INCREMENT ,
	`rentno` INT(15) NOT NULL,
	`eksoplismosid` INT(3) NOT NULL,
	PRIMARY KEY (`no`)
);

CREATE TABLE `manufacturer` (
	`mid` INT(10) NOT NULL ,
	`name` varchar(10) NOT NULL ,
	`model` varchar(20) NOT NULL,
	PRIMARY KEY (`mid`)
);

CREATE TABLE `insurance` (
	`id` INT(3) NOT NULL ,
	`name` varchar(20) NOT NULL ,
	`cost` INT(2) NOT NULL,
	PRIMARY KEY (`id`)
);

CREATE TABLE `eksoplismos` (
	`id` INT(3) NOT NULL ,
	`name` varchar(15) NOT NULL,
	`cost` INT(2) NOT NULL,
	PRIMARY KEY (`id`)
);

CREATE TABLE `rentinsurance` (
	`no` INT(15) NOT NULL AUTO_INCREMENT ,
	`rentno` INT(15) NOT NULL,
	`rentinsuranceid` INT(3) NOT NULL,
	PRIMARY KEY (`no`)
);

CREATE TABLE `category` (
	`no` INT(2) NOT NULL ,
	`type` varchar(15) NOT NULL,
	`cost` INT(3) NOT NULL,
	PRIMARY KEY (`no`)
);

CREATE TABLE `reservation` (
	`resno` INT NOT NULL AUTO_INCREMENT ,
	`catno` INT(2) NOT NULL ,
	`cusername` varchar(25) NOT NULL ,
	`rentloc` INT(4) NOT NULL ,
	`rentdate` DATE NOT NULL,
	`returndate` DATE NOT NULL,
    `total` numeric(13,6) ,
    CONSTRAINT CheckAge CHECK (rentdate > returndate),
	PRIMARY KEY (`resno`)
);

ALTER TABLE `Employee` ADD CONSTRAINT `Employee_fk0` FOREIGN KEY (`officeaa`) REFERENCES `location`(`aa`);

ALTER TABLE `car` ADD CONSTRAINT `car_fk0` FOREIGN KEY (`officeaa`) REFERENCES `location`(`aa`);

ALTER TABLE `car` ADD CONSTRAINT `car_fk1` FOREIGN KEY (`mid`) REFERENCES `manufacturer`(`mid`);

ALTER TABLE `car` ADD CONSTRAINT `car_fk2` FOREIGN KEY (`cat`) REFERENCES `category`(`no`);

ALTER TABLE `person` ADD CONSTRAINT `person_fk0` FOREIGN KEY (`username`) REFERENCES `client`(`username`);

ALTER TABLE `service` ADD CONSTRAINT `service_fk0` FOREIGN KEY (`partnerno`) REFERENCES `partner`(`partnerno`);

ALTER TABLE `chooses` ADD CONSTRAINT `chooses_fk0` FOREIGN KEY (`serviceno`) REFERENCES `service`(`serviceno`);

ALTER TABLE `chooses` ADD CONSTRAINT `chooses_fk1` FOREIGN KEY (`username`) REFERENCES `person`(`username`);

ALTER TABLE `rents` ADD CONSTRAINT `rents_fk0` FOREIGN KEY (`plate`) REFERENCES `car`(`plate`);

ALTER TABLE `rents` ADD CONSTRAINT `rents_fk1` FOREIGN KEY (`username`) REFERENCES `client`(`username`);

ALTER TABLE `rents` ADD CONSTRAINT `rents_fk2` FOREIGN KEY (`pickupofficeno`) REFERENCES `location`(`aa`);

ALTER TABLE `rents` ADD CONSTRAINT `rents_fk3` FOREIGN KEY (`returnofficeno`) REFERENCES `location`(`aa`);

ALTER TABLE `comp` ADD CONSTRAINT `comp_fk0` FOREIGN KEY (`username`) REFERENCES `client`(`username`);

ALTER TABLE `renteksoplismos` ADD CONSTRAINT `renteksoplismos_fk0` FOREIGN KEY (`rentno`) REFERENCES `rents`(`rentno`);

ALTER TABLE `renteksoplismos` ADD CONSTRAINT `renteksoplismos_fk1` FOREIGN KEY (`eksoplismosid`) REFERENCES `eksoplismos`(`id`);

ALTER TABLE `rentinsurance` ADD CONSTRAINT `rentinsurance_fk0` FOREIGN KEY (`rentno`) REFERENCES `rents`(`rentno`);

ALTER TABLE `rentinsurance` ADD CONSTRAINT `rentinsurance_fk1` FOREIGN KEY (`rentinsuranceid`) REFERENCES `insurance`(`id`);

ALTER TABLE `reservation` ADD CONSTRAINT `reservation_fk0` FOREIGN KEY (`catno`) REFERENCES `category`(`no`);

ALTER TABLE `reservation` ADD CONSTRAINT `reservation_fk1` FOREIGN KEY (`cusername`) REFERENCES `client`(`username`);

ALTER TABLE `reservation` ADD CONSTRAINT `reservation_fk2` FOREIGN KEY (`rentloc`) REFERENCES `location`(`aa`);







