create view eqcost as
select rents.rentno,eksoplismos.name
from rents,renteksoplismos,eksoplismos
where renteksoplismos.rentno = rents.rentno and renteksoplismos.eksoplismosid=eksoplismos.id
order by 1;


create view rentcost as
select eqcost.rentno,eksoplismos.cost
from eksoplismos,eqcost
where eqcost.name=eksoplismos.name 
order by eqcost.rentno;


create view eqtotal as
select rentcost.rentno,sum(rentcost.cost) as total
from rentcost
group by 1;

UPDATE rents,eqtotal
SET rents.total=rents.total+eqtotal.total
where (rents.rentno=eqtotal.rentno);


drop view if exists eqcost ;
