UPDATE rents,person,client 
set rents.total=case 
		WHEN abs(TIMESTAMPDIFF(day,rents.returndate,rents.rentdate)) <=7 THEN abs(TIMESTAMPDIFF(day,rents.returndate,rents.rentdate))*rents.total
		WHEN  abs(TIMESTAMPDIFF(day,rents.returndate,rents.rentdate))<=30 THEN 7*rents.total+(abs(TIMESTAMPDIFF(day,rents.returndate,rents.rentdate))-7)*rents.total*0.85
        ELSE (7+23*0.85+ (abs(TIMESTAMPDIFF(day,rents.returndate,rents.rentdate))-30)*0.7)*rents.total
        END
where rents.username=client.username and client.username=person.username;




UPDATE rents,client,comp
set rents.total=abs(TIMESTAMPDIFF(day,rents.returndate,rents.rentdate))*rents.total*0.7
where rents.username=client.username and client.username=comp.username;

UPDATE rents,client,person
set total =total + total*0.15
where abs(TIMESTAMPDIFF(year,DOB,CURDATE()))<23 and rents.username=client.username and client.username=person.username;

UPDATE reservation,client,person
set total =total + total*0.15
where abs(TIMESTAMPDIFF(year,DOB,CURDATE()))<23 and reservation.cusername=client.username and client.username=person.username;



